import { useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import styled from "styled-components"
import { UserContext } from "../context/context";
import { useState } from "react";

const Container = styled.div` 
width:100dvw;
height:100dvh;
background:#fefaf1;
background:#ffffff;
`
const Wrapper = styled.div`
max-width:30%;
// background:red;
gap:1rem;
`
const Header = styled.div``
const HeaderBgText = styled.p`
  font-size: 2.2rem;
  font-weight: 500;
  text-align: center;
`;
const HeaderSmText = styled.p`
text-align:center;
font-weight:100;
font-size:.85rem;
opacity:.8;
`;

const InputCon = styled.div`
width:100%;
`
const InputWrapper = styled.div`
  width: 100%;
  border: 1px solid grey;
  height: 100%;
  background: transparent;
  margin: 5px 0;
`;
const InputLabel = styled.label`
`;
const Input = styled.input`
  width: 100%;
  height: 100%;
  border: none;
  outline: none;
  color: gray;
  background: transparent;
  padding:2px 7px;
`;

const ButtonCon = styled.div`
   width:100%;
`;
const Button = styled.button`
  cursor: pointer;
  background: ${(props) =>
    props.type !== "outline" ? "#297f85" : "transparent"};
  padding: ${(props) => (props.type !== "outline" ? "10px 35px" : "10px 8px")};
  color: ${(props) => (props.type !== "outline" ? "white" : "#297f85")};
  border: none;
  width: 100%;
  box-sizing: border-box;
  font-weight:500;
  white-space: nowrap;
`;

function ResetPassword() {

  const user = useContext(UserContext);
  const dispatchUserEvent = useContext(UserContext);
  const [newEmail, setNewEmail] = useState(user.user.email);
  // console.log(user);

  return (
    <Container className="flex aic jcc">
      <Wrapper className="flex aic jcc fdc">
        <Header>
          <HeaderBgText>Reset Your Password</HeaderBgText>
          <HeaderSmText>
            Input your account email and we`ll send an OTP to your Email,To
            reset your password!.
          </HeaderSmText>
        </Header>
        {user.user ? (
          <>
            <InputCon>
              <InputLabel htmlFor="resetPassword">Email</InputLabel>
              <InputWrapper>
                <Input
                  placeholder="Enter your account email"
                  type="email"
                  id="resetPassword"
                  className=""
                />
              </InputWrapper>
            </InputCon>
            <ButtonCon className="flex aic jcc">
              <Button>Reset Password</Button>
              <Link className="link" to="/login">
                <Button type="outline" style={{ textDecoration: "underline" }}>
                  Return to login
                </Button>
              </Link>
            </ButtonCon>
          </>
        ) : (
          <ResetPasswordCon className="flex aic jcsb">
            <ResetPassword className="flex aic jcc">
              <ResetPasswordBdText className="flex aic jcc">
                Logout
              </ResetPasswordBdText>
              <ResetPasswordBdText className="flex aic jcc">
                <svg
                  stroke="rgba(255 228 92)"
                  width="1rem"
                  height="1rem"
                  className="w-5 h-5 fill-theme_secondary rotate-180"
                  viewBox="0 0 24 24"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path d="M7.707,8.707,5.414,11H17a1,1,0,0,1,0,2H5.414l2.293,2.293a1,1,0,1,1-1.414,1.414l-4-4a1,1,0,0,1,0-1.414l4-4A1,1,0,1,1,7.707,8.707ZM21,1H13a1,1,0,0,0,0,2h7V21H13a1,1,0,0,0,0,2h8a1,1,0,0,0,1-1V2A1,1,0,0,0,21,1Z" />
                </svg>
              </ResetPasswordBdText>
            </ResetPassword>
            <DeleteAccount className="flex aic jcc">
              <DeleteAccountBdText className="flex aic jcc">
                Delete Account
              </DeleteAccountBdText>
              <DeleteAccountBdText className="flex aic jcc">
                {/* <svg
                className="w-5 h-5 stroke-theme_dark_text"
                viewBox="0 0 24 24"
                xmlns="http://www.w3.org/2000/svg"
                height="1rem"
                width="1rem"
              >
                <title />

                <g id="Complete">
                  <g id="user-remove">
                    <g>
                      <path
                        d="M17,21V19a4,4,0,0,0-4-4H5a4,4,0,0,0-4,4v2"
                        fill="none"
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                      />

                      <circle
                        cx="9"
                        cy="7"
                        fill="none"
                        r="4"
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                      />

                      <line
                        fill="none"
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                        x1="17"
                        x2="23"
                        y1="11"
                        y2="11"
                      />
                    </g>
                  </g>
                </g>
              </svg> */}
                {/* <DeleteOutline sx={{ fontSize: "inherit" }} /> */}
              </DeleteAccountBdText>
            </DeleteAccount>
          </ResetPasswordCon>
        )}
      </Wrapper>
    </Container>
  );
}

export default ResetPassword
